import React from 'react'
import { Box, Stack, Typography } from '@mui/material'
const HeroBanner = () => {
  return (
    <Box>
        <Typography color="red" fontWeight="600px" font>A New and Better You</Typography>
    </Box>
  )
}

export default HeroBanner
